import React, {  useEffect, useState } from 'react'
import './dreamBoy.css'

const Parent = () => {
    const [a,setA] = useState(-1);

    const increment = ()=>{
        setA(a+1)
    }
    const decrement = ()=>{
        setA(a-1)
    }

    useEffect(() => {
      increment()

    }, [])
    
  return (
    <div className='main'>
        <h1>Dream Boy {a}</h1>
        <div className='main2'>
        <button type='button' onClick={increment}>Increment
            </button>

        <button type='button' onClick={decrement}>Decrement
            </button>
            {
                a == 5
            }

            </div>
    </div>
  )
}

export default Parent
